import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import PSPE_Logo from '../images/PSPE_logo.png';


const style = {
    navbar: {
        height: '60px',
        width: '100%',
        backgroundColor: '#df9f00',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'flex-start',
        alignItems: 'flex-start',
        color: 'black',
        boxShadow: '0 10px 20px rgba(0,0,0,0.19), 0 6px 6px rgba(0,0,0,0.23)',
        marginBottom: '10px'
    },
    logoImage: {
        height: '45px',
        width: 'auto',
        // backgroundImage: `url(${PSPE_Logo})`,
        // backgroundPosition: 'center',
        // backgroundSize: 'cover',
        // backgroundRepeat: 'no-repeat',
        alignSelf: 'center',
        verticalAlign: 'center',
        marginLeft: '20px'
    },
    logoContainer: {
        height: '100%',
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'center'
    },
    navlink: {
        color: 'black',
        fontSize: '18px',
        alignSelf: 'center',
        margin: '10px',
        textDecoration: 'none',
        fontWeight: 'bold'
    },
    "navlink:hover": {
        transition: 'color .2s ease-in-out',
        color: 'white'
    },
    navlinkCollection: {
        height: '100%',
        flexGrow: '1',
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'flex-start',
        justifyContent: 'flex-start',
        marginLeft: '30px'
    }



};

export class Navbar extends Component {
	render() {
		return(
            <div style={style.navbar}>
                <div style={style.logoContainer}>
                    <Link to="/"><img  style={style.logoImage} src={PSPE_Logo}/></Link>
                </div>
                <div style={style.navlinkCollection}>
                    <Link style={style.navlink} to="/">Home</Link>
                    <Link style={style.navlink} to="/about">About</Link>
                    <Link style={style.navlink} to="/events">Events</Link>
                    <Link style={style.navlink} to="/news">News</Link>
                    <Link style={style.navlink} to="/contact">Contact</Link>
                    <Link style={style.navlink} to="/sponsors">Sponsors</Link>
                </div>
            </div>
        );
	}
}

export default Navbar;
